import React from 'react';

interface WeatherDetailsProps {
  dataLocation: string | undefined;
  temperature: number | undefined;
  weatherDescription: string | undefined;
  cloudiness: number | undefined;
}

const WeatherDetails: React.FC<WeatherDetailsProps> = ({
  dataLocation,
  temperature,
  weatherDescription,
  cloudiness,
}) => {
  return (
    <div>
      <h2>Weather Details</h2>
      <p>Location: {dataLocation}</p>
      <p>Temperature: {temperature ? `${temperature}K` : 'N/A'}</p>
      <p>Weather: {weatherDescription || 'N/A'}</p>
      <p>Cloudiness: {cloudiness ? `${cloudiness}%` : 'N/A'}</p>
    </div>
  );
};

export default WeatherDetails;
